webpackJsonp([74492679418128],{4101:function(p,n){p.exports={data:{markdownRemark:{html:'<p>あけましておめでとうございます！ ございましたんです！もう過ぎちゃったんでございました！ んでもって500,000Hitの筈が500,000Hipになったいまいた！１！！ 今年は魔理沙の尻が一杯描ければそれでいいや(良くねぇ) 今年は亥年ならぬ尻年！(それ以前に読み間違えてないか\'Ａ｀) 正直な話、魔理沙に尻で踏まれたい。そんな煩悩くぁｗせｄｒｆｔｒｇｙよしこｌｐ；(もう略</p>\n<h2>夢終劇をお手に取っていただきありがとうございました</h2>\n<p>おかげさまで先日の冬コミC71においては完売には至らなかったものの6割弱が皆さんのお茶の間へと渡っていきました。大変感謝いたします。</p>\n<h2>(試験導入)web通販始めました</h2>\n<p>さて、運良く入手できなかった方のために<a href="http://e.danmaq.com/">今回web通販を試験導入してみました(要SSL対応ブラウザ)</a>。夢終劇に限らず、時封城＆レイラと過去のdanmaq全作品を扱っています。ちょっと暫定的に動かしてみて、もしちゃんとお買い物出来るようでしたら本格的に始動する予定です。</p>\n<h2>danmaqの今後について</h2>\n<p>今回の夢終劇が一番ピークで、ココからは暫くの間気持ち縮小気味で活動を続けようかと思います。何処をどう間違えたか就職してしまったわけだし。次に出す作品…まぁまずは時封城v2.00&#x26;夢終劇v1.02だなー。</p>\n<h2>その他の更新情報</h2>\n<p><a href="/category/products/apps?tag=java">JAVA習作ゲーム</a>をさらに2本発掘したので追加します。仕事上どうしてもJavaのスキルが必要となったので勉強がてら習作として製作したものです。</p>\n<h2>拍手レス</h2>\n<p>サボってるとすぐ溜まっちゃうからなー。</p>\n<h2>(拍)なんかもう、東方じゃなくてオリジナルでやってればいいんじゃないでしょうか？～</h2>\n<p>──東方とか、好きだから。(komkom.com氏の言葉を拝借)</p>\n<h2>(拍)死ね、氏ねじゃなくて死んでください</h2>\n<p>もっと罵って！</p>\n<h2>(拍)明日絶対に買いに行きます。夢終劇期待してます！</h2>\n<p>いかがでしたか？</p>\n<h2>(拍)なんだ入稿しやがったのか　つまんね</h2>\n<p>超ギリだったけどな！</p>\n<h2>(拍)やはり「東方○○○」と言う名前が一番紛らわしいと思うのです。～</h2>\n<p>安心してください、現状時封城と夢終劇だけです。</p>\n<h2>(拍)序にもう一発、思わず、嘘だ！！！とか言いたかった話だった</h2>\n<p>幻想郷で一番霊夢に想いを寄せているのが彼女だ、と思っていますので。だからこそ彼女が選ばれたわけです。</p>\n<h2>(拍)夢終劇恋符でラストスペル被弾時に残機が失われました。</h2>\n<p>ｍｊｄ？ちょい検証しときます</p>\n<h2>(拍)委託は1月後,,,楽しみですわー。</h2>\n<p>もしウチと同じくらいせっかちでしたら<a href="http://e.danmaq.com/">web通販</a>もﾄﾞｿﾞｰ</p>\n<h2>(拍)これは！拍手せねば成らない出来でした！すばらしいです！</h2>\n<p>ありがとうございます。</p>\n<h2>(拍)夢終劇EXボスもずるいよ？</h2>\n<p>彼女が生き残ったのも魔理沙が生き残ったのも全て偶然ですから。偶然ほどずるいもんはないですよね？前に並んでた人が福引で一等攫って行ったりとか。</p>\n<h2>(拍)旧作ラスボスを1～3面に置かないでよぉ！</h2>\n<p>彼女にとっては魔界の神も化け化けも同格の存在に過ぎなかったんです。</p>\n<h2>(拍)これからも界隈を煽り倒してくださいね</h2>\n<p>はっ！指令、承りましたっ！！</p>',frontmatter:{cover:null,date:"2007-01-04T00:00:00+09:00",strDate:"2007/1/3",title:"メリー良いお年をおめでたございまいた"}}},pathContext:{path:"/ja/blog/2007/01/04-メリー良いお年をおめでたございまいた/",langKey:"ja"}}}});
